import React from 'react';
import './App.css';

import Home from "./pages/Home";
import Rooms from "./pages/Rooms";
import SingleRooms from "./pages/SingleRooms";
import Contact from "./pages/Contact";
import Error from "./pages/Error";

function App() {
  return ( 
    <>
      <Home />
      <Rooms />
      <SingleRooms />
      <Error />
      <Contact />
    </>
  );
}

export default App;
